import React from "react";
import './Main.css'
import Cars from './index.json'
const Main = (props) => {
    const cars = Cars.cars
    const [state, setState] = React.useState([cars])
    console.log(state) 
  fetch('/index.json').then(res => res.json())
  .then(data => setState(data.cars))
    return (
        <div className="category">
            {cars.map((item, index) => (
                <div key={index} className="item">
                    <img className="img" width='100%' src={item.img} alt={item.title} />
                    <span className="title">{item.title}</span>
                    <p>1.5 л / 181 л.с. / Бензин</p>
                    <p className="price">{item.price}</p>
                    <span className="link">Подробнее</span>
                </div>
            ))}
        </div>
    );
}

export default Main;
